contract DummyStorage {
    using UnstructuredStorage for bytes32;

    bytes32 internal constant TOTAL_SHARES_POSITION =
        0xe3b4b636e601189b5f4c6742edf2538ac12bb61ed03e6da26949d69838fa447e;

    function getTotalShares() public view returns (uint256) {
        return TOTAL_SHARES_POSITION.getStorageUint256();
    }

    function setTotalShares(uint256 _new) public {
        TOTAL_SHARES_POSITION.setStorageUint256(_new);
    }
} // 0xF7Ac55C3590abcB280C45Eae3865e31E506BB339

contract L1Reader {
bytes32 internal constant TOTAL_SHARES_POSITION =
        0xe3b4b636e601189b5f4c6742edf2538ac12bb61ed03e6da26949d69838fa447e;

        address constant L1_BLOCKS_ADDRESS = 0x5300000000000000000000000000000000000001;
address constant L1_SLOAD_ADDRESS = 0x0000000000000000000000000000000000000101;
address immutable l1TokenAddress;

    constructor(address _l1TokenAddress) {
        l1TokenAddress = _l1TokenAddress;
    }

    function retrieveShares() public view returns (uint256) {
        (bool success, bytes memory returnValue) = L1_SLOAD_ADDRESS.staticcall(abi.encodePacked(l1TokenAddress, TOTAL_SHARES_POSITION));
        if(!success)
        {
            revert("L1SLOAD failed");
        }
        return abi.decode(returnValue, (uint));
    }
}

